import react from 'react';
import styled from 'styled-components';
import axios from 'axios';

const cardContainer = styled.div`
  display: flex;
  flex-direction: column;

`

function App() {
  return (
    <cardContainer>
      <div>Header</div>
      <div>Page</div>
    </cardContainer>
  );
}

export default App;
